description:
Verenigde Staten
Animatie / Actie
77 minuten

goed

met de stemmen van Matthew Wolf, Rick Gomez en Jay Brazeau

Een jonge Thor gaat samen met zijn broer Loki en een beruchte groep krijgers genaamd de Warriors Three, op zoek naar het 
legendarische zwaard van Surtur. Het zwaard geeft bijzondere, vurige krachten aan de drager ervan. Maar wat begint als een 
eenvoudige schattenjacht, mondt uit in een gevaarlijke oorlog waarin Thor zichzelf zal moeten bewijzen om het godenrijk Asgard 
te beschermen.
